stages.playscript:
echo "pre Git"
dir("./") {
    if(fileExists("${params.PROJECT_NAME}")) {
        echo " git exit"
        dir("./${params.PROJECT_NAME}") {
            checkout([$class: 'GitSCM', branches: [[name: 'dev']], userRemoteConfigs: [[credentialsId: "rddgit.changhong.com", url: "${PROJECT_GIT_PATH}"]]])
        }
    } else {
        sh " mkdir ${params.PROJECT_NAME}"
        dir("./${params.PROJECT_NAME}") {
            checkout([$class: 'GitSCM', branches: [[name: 'dev']], userRemoteConfigs: [[credentialsId: "rddgit.changhong.com", url: "${PROJECT_GIT_PATH}"]]])
            
            echo " git is not exit"
        }
    }
}

dir("./${params.PROJECT_NAME}") {
        sh "npm config set registry http://rcsgit.changhong.com:8081/repository/npm_group/"
        sh "npm-install-changed"
}
echo "npm run install"

dir("./${params.PROJECT_NAME}") { 
    sh "npm run build"
}
echo "npm run build"

echo "generate docker image"
dir("./${params.PROJECT_NAME}") { 
    sh "rm -rf docker/dist"
    sh "cp -rf dist docker/dist"
    dir("./docker") {
        sh "docker build -t rddhub.changhong.com/sei/${params.PROJECT_NAME}:dev ."
    }
}

echo "deploy project"
def remote = [:]
remote.name = "deplay"
remote.host = "10.4.208.86"
remote.allowAnyHosts = true

withCredentials([usernamePassword(credentialsId: '10.4.208.86', passwordVariable: 'password', usernameVariable: 'userName')]) {
    withCredentials([usernamePassword(credentialsId: 'rddhub.changhong.com', passwordVariable: 'dockerPassword', usernameVariable: 'dockerUser')]) {
        remote.user = userName
        remote.password = password
        sshCommand remote: remote, command: "/opt/sei4.0/container_update.sh \"docker login -u ${dockerUser} -p ${dockerPassword} rddhub.changhong.com\" \"rddhub.changhong.com/sei/${params.PROJECT_NAME}:dev\" \"${params.PROJECT_NAME}\""
    }
}
